import React, { useEffect, useState } from "react";
import "../styles/pagesstyle.css";

const Dashboard = () => {
  const email = localStorage.getItem("userEmail");
  const [username, setUsername] = useState("");
  const [expenses, setExpenses] = useState([]);
  const [formData, setFormData] = useState({ amount: "", category: "", description: "" });
  const [deleteId, setDeleteId] = useState("");

  // Fetch user details and expenses
  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const response = await fetch(`http://localhost:5000/dashboard?email=${email}`);
        const data = await response.json();
        if (response.ok) {
          setUsername(data.username);
          setExpenses(data.expenses);
        } else {
          console.error("Error fetching user data:", data.message);
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };

    if (email) fetchUserData();
  }, [email]);

  const totalIncome = expenses.filter(exp => exp.category === "Income").reduce((acc, curr) => acc + curr.amount, 0);
  const totalExpense = expenses.filter(exp => exp.category === "Expense").reduce((acc, curr) => acc + curr.amount, 0);

  // Handle input change
  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  // Add Expense
  const handleAddExpense = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:5000/add-expense", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ ...formData, email }),
      });

      if (response.ok) {
        alert("Expense Added Successfully!");
        const newExpense = await response.json();
        setExpenses((prev) => [...prev, newExpense]);
      } else {
        alert("Error adding expense");
      }
    } catch (error) {
      console.error("Error:", error);
      alert("Error connecting to server");
    }
  };

  // Delete Expense
  const handleDeleteExpense = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:5000/delete-expense", {
        method: "DELETE",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ id: deleteId, email }),
      });

      if (response.ok) {
        alert("Expense Deleted Successfully!");
        setExpenses((prev) => prev.filter(exp => exp.id !== deleteId));
      } else {
        alert("Error deleting expense");
      }
    } catch (error) {
      console.error("Error:", error);
      alert("Error connecting to server");
    }
  };

  const handleDownloadPDF = async () => {
    try {
      const response = await fetch("http://localhost:5000/export-pdf");
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = "ExpenseData.pdf";
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
    } catch (error) {
      console.error("Error downloading PDF:", error);
    }
  };


  return (
    <div className="dashboard-content">
      <nav className="dashboard-navbar">
        <div className="dashboard-logo">
          <img src="https://github.com/Sanjeevan1122003/expense-tracker-demo/blob/main/dashboard_logo.png?raw=true" alt="Logo" className="logo" />
        </div>
        <div className="dashboard-buttons">
          <button className="dashboard-button"><a href="#sectionHome">Home</a></button>
          <button className="dashboard-button"><a href="#sectionExpense">Expenses</a></button>
          <button className="dashboard-button"><a href="#sectionData">Your Data</a></button>
        </div>
      </nav>

      <section id="sectionHome">
        <div className="home-content">
          <div className="home-card">
            <div className="home-card-description">
              <h1>Hi, <span className="highlights">{username}</span></h1>
              <h2>Welcome to <span className="highlights">Expense Tracker</span> Dashboard</h2>
              <p>Manage your daily expenses efficiently and take control of your financial health.</p>
            </div>
          </div>
        </div>
      </section>

      <section id="sectionExpense">
        <div className="expense-content">
          <div className="expense-card">
            <p className="expense-card-title">Add Expense</p>
            <form onSubmit={handleAddExpense}>
              <input type="number" name="amount" placeholder="Enter amount" required onChange={handleChange} />
              <select name="category" required onChange={handleChange}>
                <option value="">Select Category</option>
                <option value="Income">Income</option>
                <option value="Expense">Expense</option>
              </select>
              <input type="text" name="description" placeholder="Enter details" onChange={handleChange} />
              <button type="submit">Add Expense</button>
            </form>
          </div>

          <div className="expense-card">
            <p className="expense-card-title">Delete Expense</p>
            <form onSubmit={handleDeleteExpense}>
              <input type="number" name="id" placeholder="Enter Expense ID" required onChange={(e) => setDeleteId(e.target.value)} />
              <button type="submit">Delete Expense</button>
            </form>
          </div>
        </div>
      </section>

      <section id="sectionData">
        <div className="data-content">
          <h3>Total Income: {totalIncome}</h3>
          <h3>Total Expense: {totalExpense}</h3>
          <button onClick={handleDownloadPDF}>Download PDF</button>
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Amount</th>
                <th>Category</th>
                <th>Description</th>
              </tr>
            </thead>
            <tbody>
              {expenses.map((exp, index) => (
                <tr key={index}>
                  <td>{exp.id}</td>
                  <td>{exp.amount}</td>
                  <td>{exp.category}</td>
                  <td>{exp.description}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>

      <div className="footer">
        <p>&copy; 2025 Expense Tracker</p>
      </div>
    </div>
  );
};

export default Dashboard;
